import { Grid } from '@material-ui/core';
import "./Landing.css";

function Menu() {
  return (
    <Grid container justify="center" alignContent="center">
        <ul className="menu">
            <Grid item sm={12}>
                <li>j</li>
            </Grid>
            <Grid item sm={12}>
                <li>e</li>
            </Grid>
            <Grid item sm={12}>
                <li>z</li>
            </Grid>
    </ul>
    </Grid>
    
  );
}

export default Menu;
